import React from "react";
import "../../../styles/register.css";
import arrowBack from "../../../assets/images/icon/arrowBack.png"
import Step1 from "./Step1";
import Step2 from "./Step2";
import Step3 from "./Step3";
import Step4 from "./Step4";
import Step5 from "./Step5";
import Step6 from "./Step6";
import Step7 from "./Step7";

class RegistrationDealer extends React.Component{
    constructor(props){
        super(props)
        this.state ={
            step: 1,
            isSuccess: 0
        }
    }

    prevStep = () =>{
        this.setState({
         step: this.state.step - 1
        })
     }
 
     nextStep = () =>{
         this.setState({ step: this.state.step + 1 });
     }

    render(){
        const steps = this.state.step;
        return(
            <div className="resgister-step">
                {/* Header Progress */}
                <div className="progress-step-con">
                    <button className="btn-back"><img src={arrowBack} alt="" srcset="" /></button>
                    <div className="progress-bar" style={{ width: "140px" }}><div className="progress-bar-inner"></div></div>
                    <span className="pager">
                        <span className="pager-count">1 </span>
                        <span className="pager-total">| 7</span>
                    </span>
                </div>
                {/* Content */}
                <div className="register-step-content"> 
                    {/* <Step1 /> */}
                    {/* <Step2 /> */}
                    {/* <Step3 /> */}
                    {/* <Step4 /> */}
                    {/* <Step5 /> */}
                    {/* <Step6 /> */}
                    <Step7 />
                </div>
            </div>
        )
    }
}

export default RegistrationDealer;
